import ContactForm from "./ContactForm";
import ContactInfo from "./ContactInfo";
import QuickInfo from "./QuickInfo";

const Contact = () => {
  return (
    <div>
      <HeroSection />
      <ContactForm />
      <ContactInfo />
      <QuickInfo />
    </div>
  );
};

export default Contact;
